import * as React from 'react';
import { Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { Loader2, Home } from 'lucide-react';

// Lazy load components for better performance
const Homepage = React.lazy(() => import('./pages/Homepage'));
const UserLayout = React.lazy(() => import('./layouts/UserLayout'));
const AdminLayout = React.lazy(() => import('./layouts/AdminLayout'));
const ReportLayout = React.lazy(() => import('./layouts/ReportLayout'));
const Dashboard = React.lazy(() => import('./pages/user/Dashboard'));
const Calendar = React.lazy(() => import('./pages/user/Calendar'));
const Notifications = React.lazy(() => import('./pages/user/Notifications'));
const LogCommunication = React.lazy(() => import('./pages/user/LogCommunication'));
const FrequencyReport = React.lazy(() => import('./pages/reports/FrequencyReport'));
const OverdueTrends = React.lazy(() => import('./pages/reports/OverdueTrends'));
const EngagementEffectiveness = React.lazy(() => import('./pages/reports/EngagementEffectiveness'));
const ActivityLog = React.lazy(() => import('./pages/reports/ActivityLog'));
const CompanyList = React.lazy(() => import('./pages/admin/CompanyList'));
const CommunicationMethod = React.lazy(() => import('./pages/admin/CommunicationMethod'));

// Loading component with spinner
const LoadingSpinner = () => (
  <div className="min-h-screen flex items-center justify-center bg-gray-50">
    <div className="text-center">
      <Loader2 className="h-8 w-8 animate-spin text-blue-600 mx-auto" />
      <p className="mt-2 text-sm text-gray-600">Loading...</p>
    </div>
  </div>
);

const App = () => {
  return (
    <Router>
      <div className="min-h-screen">
        <Link to="/" className="home-button">
          <Home className="w-4 h-4 inline-block mr-2" />
          Home
        </Link>
        <Suspense fallback={<LoadingSpinner />}>
          <Routes>
            // ... keep existing code (route definitions)
          </Routes>
        </Suspense>
      </div>
    </Router>
  );
};

export default App;
